    function chart(chart, serias) {
        $.serias = serias;
        var a = getMaxOfArray($.serias[1]);
        $(chart).html('');
        $.each($.serias[1], function(index, value) {
            if ($.serias[0][index])
                $(chart).append('<div class="bar"><div class="serias"></div><div class="serias-2"></div><div class="serias-name">' + $.serias[0][index] + '</div></div>');
        });
        $(chart + ' .bar').each(function() {
            var percent = ($.serias[1][$(this).index()] / a) * 100;
            var bt1 = 0;
            if ($.serias[3]) {
                bt1 = ($.serias[3][$(this).index()] / a) * 100;
            }
            var m = 0;
            if (getMinOfArray(serias[1]) == -0) {
                m = '';
            }
            $(this).find('.serias').animate({
                'height': (percent - bt1) + '%',
                'bottom': bt1 + '%'
            }, 1000);
            $(this).find('.serias').attr('title', $.serias[1][$(this).index()] + '');
            var percent2 = ($.serias[2][$(this).index()] / a) * 100;
            if (percent2 > percent) {
                $(this).find('.serias').css({
                    'z-index': 2
                });
                $(this).find('.serias-2').css({
                    'z-index': 1
                });
            } else {
                $(this).find('.serias').css({
                    'z-index': 1
                });
                $(this).find('.serias-2').css({
                    'z-index': 2
                });
            }
            var bt = 0;
            if ($.serias[4]) {
                bt = ($.serias[4][$(this).index()] / a) * 100;
            }
            $(this).find('.serias-2').animate({
                'height': (percent2 - bt) + '%',
                'bottom': bt + '%'
            }, 2000);
            $(this).find('.serias-2').attr('title', $.serias[2][$(this).index()] + '');
        });
        $(chart).append('<div class="line"></div><div class="line"></div><div class="line"></div><div class="line"></div>');
        var nl = 0;
        var ln = a / 4;
        var L = 0;
        $(chart + ' .line').each(function() {
            nl += 25;
            L = L + ln;
            $(this).css({
                'bottom': nl + '%'
            }).append('<div class="name">' + L.toFixed(1) + '</div>');
        });
        $(chart).prepend('<div class="line"><div class="name">0</div></div>');
    }
